    false,nt"url": null,nt"notes": "This annual narrative report for Okefenokee
    and Banks Lake National Wildlife Refuges summarizes refuge activities during the
    1981 calendar year.  The report begins with a summary of the yearu2019s highlights
    and climatic conditions.   Land acquisition-including fee title is also covered.
     The report includes a planning section which discusses master plan, management
    plan, public participation, research and investigations.  Refuge administration
    is outlined; information about personnel, funding, safety, technical assistance,
    and other items is given.  Habitat management is also covered.  Subjects include
    general, wetlands, forests, fire management, pest control, wilderness and special
    areas.  The wildlife section of the report discusses wildlife diversity, endangered
    and/or threatened species, waterfowl, marsh and water birds, shorebirds, gulls,
    terns, and allied species, raptors, other migratory birds, game mammals, other resident
    wildlife, fisheries resources, marking and banding.  The public uses of the refuge
    described in this report include general, outdoor classrooms - students, outdoor
    classrooms - teachers, interpretive foot trails, interpretive foot routes, interpretive
    exhibits/demonstrations, hunting, fishing, wildlife observation, other wildlife
    oriented recreation, camping, picnicking, other non-wildlife oriented recreation,
    law enforcement, youth programs, cooperating associations, concessions, and volunteer
    programs.  The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance,.  Items of interest are
    provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
